import React, { useContext, useEffect, useState } from 'react';
import '../../App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTimes } from '@fortawesome/free-solid-svg-icons'; 
import {
    withRouter
} from 'react-router-dom'


function CheckoutBodyConfirm(props) { 

    return(
        <div className={props.accountOpen === false ? 'Account displayNone' : 'Account'}>
            <div className="account-container">
                <div className="search-header flex">
                    <div className="search-title">My Account</div>
                    <div
                        className="search-close"
                        onClick={props.clickToClose}
                        >
                        <FontAwesomeIcon 
                            icon={faTimes}
                            className="icon"
                            />
                    </div>
                </div >
            </div>
        </div>
    )
}

export default withRouter(CheckoutBodyConfirm);
